@Test(expected=AlreadySetException.class)
public void testSettingCtor() throws Exception {
  SetOnce<Integer> set = new SetOnce<Integer>(new Integer(5));
  assertEquals(5, set.get().intValue());
  set.set(new Integer(7));
}

